import React from 'react'

export default function Reviews({reviews}) {
  return (
    <div className=''>
        <h1>Users Reviews</h1>

        {reviews.map((review) => (
                <div className='review' key={review.id}>
                        <h3>{review.name}</h3>
                        <p>{review.comment}</p>
                </div>
                ))}



    </div>
  )
}
